    id: 133005,
    name: "Juggernaut XL",
    description:
      '<p><span style="color:rgb(219, 222, 225)">For business inquires, commercial licensing, custom models, and consultation contact me under </span><a target="_blank" rel="ugc" href="mailto:juggernaut@rundiffusion.com"><span style="color:rgb(219, 222, 225)">juggernaut@rundiffusion.com</span></a></p><p><span style="color:rgb(219, 222, 225)">Juggernaut is available on the new Auto1111 Forge on </span><a target="_blank" rel="ugc" href="http://rundiffusion.com/?utm_source=Civitai&amp;utm_medium=referral&amp;utm_campaign=Kandoo"><span style="color:rgb(34, 139, 230)">RunDiffusion</span></a></p><p><a target="_blank" rel="ugc" href="https://huggingface.co/RunDiffusion/Juggernaut-XL-v9"><span style="color:rgb(34, 139, 230)">JuggernautXL V9 + RunDiffusion Photo 2 on Hugging Face</span></a></p><p><a target="_blank" rel="ugc" href="https://huggingface.co/RunDiffusion/Juggernaut-XL-Lightning">Juggernaut + RunDiffusion Photo2 Lightning 4 Steps on Hugging Face</a></p><p>A big thanks for Version 9 goes to <a target="_blank" rel="ugc" href="http://rundiffusion.com/?utm_source=Civitai&amp;utm_medium=referral&amp;utm_campaign=Kandoo">RunDiffusion</a> (<a target="_blank" rel="ugc" href="https://rundiffusion.com/rundiffusion-photo">Photo Model</a>) and <a target="_blank" rel="ugc" href="https://twitter.com/Colorblind_Adam">Adam</a>, who diligently helped me test :) (Leave some love for them ;) )</p><p></p><p>I\'m back so quickly :D</p><p>This time I\'ll spare you a lot of talk. Over the past 2 months, there has been repeated demand for a Turbo and/or LCM checkpoint. However, I wasn\'t completely convinced by either option. The Lightning LoRA\'s seem a bit more mature to me and ultimately delivered the best results in tests among these 3 options. Additionally, the fact that I don\'t have to change the license here is certainly an additional plus for me and for you :)</p><p>In the end, I decided to take the first step for the <strong>4 Steps LoRA</strong> and merged it with Juggernaut V9. However, I will probably also release the 8 Steps version in the next few days. Regarding the fundamental quality, I still recommend the full V9 checkpoint for the best possible quality. But especially for people with less hardware power, this version will benefit them and they will be able to generate images very quickly :) So if you haven\'t yet had the pleasure of experiencing Juggernaut, this might be the perfect opportunity :)</p><p></p><h3 id="heading-5"><strong>Recommended Settings for the Lightning Version:</strong></h3><p><img src="https://image.civitai.com/xG1nkqKTMzGDvpLrqFT7WA/744cc73a-93c6-46cf-a524-78570968ddf4/width=525/744cc73a-93c6-46cf-a524-78570968ddf4.jpeg" /></p><p><strong>Res: 832*1216</strong></p><p><strong>Sampler: DPM++ SDE</strong></p><p><strong>Steps: 4-6</strong></p><p><strong>CFG: 1-2</strong></p><p><strong>Negative: Start with no negative, and add afterwards the Stuff you don´t wanna see in that image.</strong></p><p><strong>HiRes: 4x_NMKD-Siax_200k with 2 Steps and 0.35 Denoise + 1.5 Upscale</strong></p><p></p><p></p><h3 id="heading-6"><strong>Recommended Settings for the Normal Version:</strong></h3><p><strong>Res: 832*1216</strong></p><p><strong>Sampler: DPM++ 2M Karras</strong></p><p><strong>Steps: 30-40</strong></p><p><strong>CFG: 3-7 (less is a bit more realistic)</strong></p><p><strong>Negative: Start with no negative, and add afterwards the Stuff you don´t wanna see in that image. I don´t recommend using my Negative Prompt, i simply use it because i am lazy :D</strong></p><p><strong>VAE is already Baked In</strong></p><p><strong>HiRes: 4xNMKD-Siax_200k with 15 Steps and 0.3 Denoise + 1.5 Upscale</strong></p><p>And a few keywords/tokens that I regularly use in training, which might help you achieve the optimal result from the version:</p><ul><li><p><strong>Architecture Photography</strong></p></li><li><p><strong>Wildlife Photography</strong></p></li><li><p><strong>Car Photography</strong></p></li><li><p><strong>Food Photography</strong></p></li><li><p><strong>Interior Photography</strong></p></li><li><p><strong>Landscape Photography</strong></p></li><li><p><strong>Hyperdetailed Photography</strong></p></li><li><p><strong>Cinematic</strong></p></li><li><p><strong>Movie Still</strong></p></li><li><p><strong>Mid Shot Photo</strong></p></li><li><p><strong>Full Body Photo</strong></p></li><li><p><strong>Skin Details</strong></p></li></ul><p></p><p>And now, have fun trying it out. As always, I\'m eagerly waiting for your pictures in the Gallery :)</p><p>If you liked the model, please leave a review. In the end, that\'s what helps me the most as a creator on CivitAI. :)</p><p>Last but not least, I\'d like to thank a few people without whom Juggernaut XL probably wouldn\'t have come to fruition:</p><p></p><p><a target="_blank" rel="ugc" href="http://Dreamlook.AI">Dreamlook.AI</a> (Trained 3 Side Sets)</p><p><a target="_blank" rel="ugc" href="https://civitai.com/user/chillpixel/models">Chillpixel</a></p><p><a target="_blank" rel="ugc" href="https://civitai.com/user/SilasAI6609/models">SilasAI6609</a></p><p><a target="_blank" rel="ugc" href="https://twitter.com/Colorblind_Adam">Adam</a></p><p></p>',
